import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";
import './main.css'


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

 
 function toggle(){
  if(document.getElementById('mySide'). style.display ==='block' ){
    document.getElementById('mySide').style.display = 'none'
  }else{
    document.getElementById('mySide').style.display = 'block'
  }

  }

  function closetoggle(){
  document.getElementById('mySide').style.display = 'none'
  }

    return(
        <div style={{backgroundcolor:'white'}}>

<nav className="w3-sidebar w3-bar-block w3-black w3-card w3-animate-left w3-hide-medium w3-hide-large"   id={props.sidebar} >
  <a href="javascript:void(0)" onClick={props.close}  class="w3-bar-item w3-button w3-large w3-padding-16">{props.closen}</a>
  <a href="#about"  class="w3-bar-item w3-button">{props.home}</a>
  <a href="#team"   class="w3-bar-item w3-button">{props.team}</a>
  <a href="#work"  class="w3-bar-item w3-button">{props.work}</a>
  <a  onClick={props.navi}  class="w3-bar-item w3-button">{props.login}</a>
  <a href="#contact"  class="w3-bar-item w3-button">{props.contact}</a>
</nav>



<div class="w3-top">
  <div className="w3-bar w3-white w3-card" id="myNavbar">
    <a href="#home" className="w3-bar-item w3-button w3-wide">VOTE</a>
    <div class="w3-right ">
    <a onClick={Logout} class="w3-bar-item w3-button">Logout</a>
    </div>
    <div>
  
    </div>

    <a href="javascript:void(0)" class="w3-bar-item w3-button w3-left w3-hide-large w3-hide-medium" onClick={toggle} >
      <i class="fa fa-bars"></i>
    </a>
  </div>
</div>
        </div>
    );
}

export default Main;
